import Phaser from "phaser";
import carrot from "../Game/carrot";
var carrots
var platforms
var player
var cursors
export default class BunnyJumpScene extends Phaser.Scene{
    constructor(){
        super('bunny-jump-scene');
    }

    preload(){
        this.load.image('bg', 'images/bg_layer1.png');
        this.load.image('bjump', 'images/bunny1_jump.png')
        this.load.image('bstand', 'images/bunny1_stand.png')
        this.load.image('carot', 'images/carrot.png')
        this.load.image('kalah', 'images/gameover.png')
        this.load.image('grass', 'images/ground_grass.png')
        this.load.image('replay', 'images/replay.png')
    }


    create(){
        this.add.image(500,500, 'bg');
        this.add.image(240,320,  'bg').setScrollFactor(1,0)
        this.carrots = this.physics.add.group({
            classType: carrot
        })
        this.cameras.main.setDeadzone(this.scale.width * 1.5)
        this.platforms= this.physics.add.staticGroup()
        for(let i =0; i<5; i++){
            const x = Phaser.Math.Between(80, 400)
            const y = 142 * i
            const platformChild = this.platforms.create(x, y,'grass') 
            platformChild.setScale(0.5) 
            platformChild.refreshBody() 
            const body = platformChild.body 
            body.updateFromGameObject()

        }

        this.player = this.physics.add.sprite(240, 320, 'bstand').setScale(0.5)
        this.physics.add.collider(this.player, this.platforms)

        this.player.body.checkCollision.up = false
        this.player.body.checkCollision.left = false
        this.player.body.checkCollision.right = false

        this.cameras.main.startFollow(this.player)
        this.cursors = this.input.keyboard.createCursorKeys()

    }


    update(){
        this.horizontalWrap(this.player)
        const touchingDown = this.player.body.touching.down
        if (touchingDown){
            this.player.setVelocityY(-365)
            this.player.setTexture('bjump')
        }

        const vy = this.player.body.velocity.y
        if (vy > 0 && this.player.texture.key !=='bstand'){
            this.player.setTexture('bstand')
        }

        if (this.cursors.left.isDown && !touchingDown){
            this.player.setVelocityX(-200)
        }else if(this.cursors.right.isDown && !touchingDown){
            this.player.setVelocityX(200)
        }else{
            this.player.setVelocityX(0)
        }

        this.platforms.children.iterate(child => {
            const platformChild = child
            const scrollY = this.cameras.main.scrollY
            if (platformChild.y >= scrollY + 800) {
                platformChild.y = scrollY - Phaser.Math.Between(50, 100)
                platformChild.body.updateFromGameObject()
            }
        });
    }
    horizontalWrap(sprite){
        const halfWidth = sprite.displayWidth * 0.5
        const gameWidth = this.scale.width
        if(sprite.x < -halfWidth){
            sprite.x = gameWidth + halfWidth
        }else if(sprite.x > gameWidth + halfWidth){
            sprite.x = -halfWidth
        }
    }
}
